import React from 'react';
import {View,Text,Button,SafeAreaView} from 'react-native'


const About = ({route,navigation})=>{
    const {itemId} = route.params
    const data= itemId
    return(
        <>
            <View>
                <Text>
                   {data.Location}
                </Text>
            </View>
        </>
    )
}
export default About
